import Fetch from './Fetch';
import { Carousel } from 'react-bootstrap';

export default function Discover () {

    const uri = 'https://api.themoviedb.org/3/discover/movie?language=en-US&region=US&sort_by=popularity.desc&include_adult=false&include_video=false&with_watch_monetization_types=flatrate';

    return (
        <div className="row discover">
            <h1>Discover</h1>
            <Fetch 
                renderSuccess={movies}
                uri={uri}
            />
        </div>
    );

    function movies(data) {
        return (
            <Carousel fade>
                <Carousel.Item>
                    <img
                        src="https://image.tmdb.org/t/p/w780/9yBVqNruk6Ykrwc32qrK2TIE5xw.jpg"
                    />
                    <Carousel.Caption>
                        <h1>Movies title</h1>
                        <p>Something about movie</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <Carousel.Caption>
                        <h1>Movies title</h1>
                        <p>Something about movie</p>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel> 
        );
        // return <pre>{JSON.stringify(data, null, 2)}</pre>
    }

    function test (data) {
        data.results.map(movie => {
            <Carousel.Item>
                <img 
                    src={movie.poster_path}
                />
                <Carousel.Caption>
                    <h2>{movie.title}</h2>
                </Carousel.Caption>
            </Carousel.Item>
        });
    }
}
